We can now start doing MySQL work. As a reminder, we've created a new MySQL user named opacuser and a new database for opacuser that is called opacdb . When we run the show databases command as the opacuser user, we should see the opacdb database. Note below that I use the -p option. This instructs MySQL to request the password for the opacuser user, which is required to log in. mysql -u opacuser -p Then from the MySQL prompt, list the available databases and switch to the new opacdb database: show databases;
use opacdb; A database is not worth much without data. In the following code, I create and define a new table for our opacdb database. The table will be called books , and it will contain data describing some books. We will keep this table very simple and use only three fields: create table books (
id int unsigned not null auto_increment,
author varchar(150) not null,
title varchar(150) not null,
copyright date not null,
primary key (id)
); You can confirm that the table was created by running the following two commands, which lists the available tables and then describes the books table: show tables;
describe books; Congratulations! Now create some records for that table.

