In order for PHP to connect to MySQL, it needs to authenticate itself. To do that, we will create a login.php file in /var/www/html . We also need to change the group ownership of the file and its permissions so that the file can be read by the Apache2 web server but not by the world, since this file will store password information. cd /var/www/html/
sudo touch login.php
sudo chmod 640 login.php
sudo chown :www-data login.php
ls -l login.php
sudo nano login.php In the file, add the following credentials. If you used a different database name than opacdb and a different username than opacuser , then you need to substitute your names below. You need to use your own password where I have the Xs: <?php // login.php
$db_hostname = "localhost";
$db_database = "opacdb";
$db_username = "opacuser";
$db_password = "XXXXXXXXX";
?> Next we create a new PHP file for our website. This file will display HTML but will primarily be PHP interacting with our books database. Create a file titled opac.php . sudo nano opac.php Then copy over the following text (I suggest you transcribe it, especially if you're interested in learning a bit of PHP, but you can simply copy and paste it into the nano buffer): <html>
<head>
<title>MySQL Server Example</title>
</head>
<body> <h1>A Basic OPAC</h1> <p>We can retrieve all the data from our database and book table
using a couple of different queries.</p> <?php // Load MySQL credentials
require_once 'login.php'; // Establish connection
$conn = mysqli_connect($db_hostname, $db_username, $db_password) or die("Unable to connect"); // Open database
mysqli_select_db($conn, $db_database) or die("Could not open database '$db_database'"); echo "<h2>Query 1: Retrieving Publisher and Author Data</h2>"; // Query 1
$query1 = "select * from books";
$result1 = mysqli_query($conn, $query1); while($row = $result1->fetch_assoc()) { echo "<p>Publisher " . $row["publisher"] . " published a book by " . $row["author"] . ".</p>";
} mysqli_free_result($result1); echo "<h2>Query 2: Retrieving Author, Title, Date Published Data</h2>"; $result2 = mysqli_query($conn, $query1);
while($row = $result2->fetch_assoc()) { echo "<p>A book by " . $row["author"] . " titled <em>" . $row["title"] . "</em> was released on " . $row["copyright"] . ".</p>";
} // Free result2 set
mysqli_free_result($result2); /* Close connection */
mysqli_close($conn); ?> </body>
</html> Save the file and exit out of nano.

