Here is the PHP for our search script, which should be named search.php : <?php
// Load MySQL credentials
require_once 'login.php'; // Establish connection
$conn = mysqli_connect($db_hostname, $db_username, $db_password) or die("Unable to connect"); // Open database
mysqli_select_db($conn, $db_database) or die("Could not open database '$db_database'"); // Check if search query was submitted
if (isset($_POST['search'])) { // Sanitize user input to prevent SQL injection attacks $search = mysqli_real_escape_string($conn, $_POST['search']); // Get the start and end dates for the date range $start_date = mysqli_real_escape_string($conn, $_POST['start_date']); $end_date = mysqli_real_escape_string($conn, $_POST['end_date']); // Build the MySQL query with a WHERE // clause that includes the date range filter $query = "SELECT * FROM books WHERE (author LIKE '%$search%' OR title LIKE '%$search%' OR publisher LIKE '%$search%') AND copyright BETWEEN '$start_date' AND '$end_date'"; // Execute the query $result = mysqli_query($conn, $query); // Check if any results were returned if (mysqli_num_rows($result) > 0) { // Loop through the results and output them while ($row = mysqli_fetch_assoc($result)) { echo "ID: " . $row["id"] . "<br>"; echo "Author: " . $row["author"] . "<br>"; echo "Title: " . $row["title"] . "<br>"; echo "Publisher: " . $row["publisher"] . "<br>"; echo "Copyright: " . $row["copyright"] . "<br><br>"; } } else { echo "No results found."; } // Free up memory by closing the MySQL result set mysqli_free_result($result);
