The WordPress documentation describes how to use phpMyAdmin to create the database and a user for WordPress. phpMyAdmin is a graphical front end to the MySQL relational database that you would access through the browser. We are not going to install that because I like to minimize the software that we install on servers to reduce the server's security exposure. Though you can use phpMyAdmin from a different machine and connect to the server, this is a command line class anyway. Therefore, we are going to create the WordPress database and a database user using the same process we used to create a database and user for our bare bones OPAC. You already know this, but the general instructions are: Switch to the root Linux user Login as the MySQL root user Specifically, we do the following on the command line: sudo su
mysql -u root The mysql -u root command places us in the MySQL command prompt. The next general instructions are to: Create a new user for the WordPress database Be sure to replace the Xs with a strong password Create a new database for WordPress Grant all privileges to the new user for the new database Examine the output Exit the MySQL prompt Specifically, this means the following (be sure to replaces the Xs with a unique and strong password of your own): create user 'wordpress'@'localhost' identified by 'XXXXXXXXX';
create database wordpress;
grant all privileges on wordpress.* to 'wordpress'@'localhost';
show databases;
\q

