When we created our bare bones OPAC, we created a file called login.php that contained the name of the database (e.g., opacdb), the name of the database user (e.g., opacuser), and the user's password. WordPress follows a similar process, but instead of login.php , it uses a file called wp-config.php . Follow these general steps: Change to the wordpress directory, if you haven't already. Copy and rename the wp-config-sample.php file to wp-config.php . Edit the file and add your WordPress database name, user name, and password in the fields for DB_NAME , DB_USER , and DB_PASSWORD . This means that we specifically do the following: cd /var/www/html/wordpress
sudo cp wp-config-sample.php wp-config.php
sudo nano wp-config.php Using nano, add your database name, user, and password in the appropriate fields, just like we did with our login.php file for our bare bones OPAC. Additionall, we want to disable FTP uploads to the site. To do that, navigate to the end of the file and add the following line: define('FS_METHOD','direct');
